import React from 'react'
import { useState } from 'react'
import axios from 'axios'
export default function ResetPassword() {
  const [email,setEmail]=useState('')
  const [loading,setLoading]=useState(false)
  const handleSubmit= async (e)=>{
    e.preventDefault();
   
    try{
      setLoading(true)
      const signupData={
      
        email:email
        
      }
      
      const response=await axios.post('http://localhost:8000/auth/users/',signupData);
      console.log("Signup Sucessfully",response.data);
      // navigate('/login')
    }catch(error){
      console.log("Signup failed",error.response.data)
    }finally{
      setLoading(false);
    }
    
  }
  return (
    <div>
      <span>Email</span>
        <input type='text'value={email} onChange={(event)=>setEmail(event.target.value)} /><br/>
        <input type='Button' value='Submit' onClick={handleSubmit} disabled={loading} />
    </div>
  )
}
